    render() {
        
        this.onBtnHandler = () => {
            console.log('test', this.state);
        }
        this.open = () => {
            console.log('open');
        }
        return (
            <div>
                <Header 
                    onBtnClickHandler = {this.onBtnHandler}
                    open = {this.open} />
            </div>
        );
    };
};
